import React, { useState, useEffect } from 'react';
import Card from '../comps/Card';
import { Cards } from '../style/comps';
import sample from '../photos/sample.jpeg';

const Home = () => {
    const [content, setContent] = useState([]);

    useEffect(async () => {
        const response = await fetch('http://localhost:3500/articles/all');
        const data = await response.json();
        setContent(data);
    }, []);

    console.log(content);



    return (<div>
        <Cards>
            {content.map((info) => {
                <Card title="ok" photo={info.card_image_link} desc={info.card_desc}></Card>
            })}
        </Cards>
    </div>);
}

export default Home;
